import React from "react";
import { useStyles } from "./styles/style";
//material-ui
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";
//COMPONENT
import { Card } from "./card";
import { A } from "./A";
import { B } from "./B";
import { C } from "./C";
import { D } from "./D";

import { NavLink, Route, Switch, BrowserRouter as Bro } from "react-router-dom";

export const Main = () => {
  let classes = useStyles();

  return (
    <Bro>
      <div className="main">
        <React.Fragment>
          <Container justify="center" maxWidth="md">
            <Grid className={classes.main} container>
              <NavLink className={ classes.card } to="/a">
                <Card url={"A"} />
              </NavLink>
              <NavLink className={ classes.card } to="/b">
                <Card className={ classes.card } url={"b"} />
              </NavLink>
              <NavLink className={ classes.card } to="/c">
                <Card url={"c"} />
              </NavLink>
              <NavLink className={ classes.card } to="/d">
                <Card url={"d"} />
              </NavLink>
            </Grid>

            <Switch>
              <Route path="/a" component={ A } />
              <Route path="/b" component={ B } />
              <Route path="/c" component={ C } />
              <Route path="/d" component={ D } />
            </Switch>

          </Container>
        </React.Fragment>
      </div>
    </Bro>
  );
};
